import logo from './logo.png';
import cart_icon from './cart_icon.png';
import hand_icon from './hand_icon.png';
import arrow_icon from './arrow.png';
import hero_img from './hero_image.png';
import exclusive_img from './exclusive_image.png';
import footer_logo from './logo_big.png';
import instagram from './instagram_icon.png';
import pintester from './pintester_icon.png';
import whatsapp from './whatsapp_icon.png';

export default {
    logo,
    cart_icon,
    hand_icon,
    arrow_icon,
    hero_img,
    exclusive_img,
    footer_logo,
    instagram,
    pintester,
    whatsapp
};
